INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "アヤネ", "2020/07/31 12:00:00", 10046, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, 24, 401, 24001, 0.0, 2, 102301, 2, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "アヤネ", "2020/07/31 12:00:00", 10046, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 0.0, 24, 402, 24002, 2.21, 1, 102301, 2, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "アヤネ", "2020/07/31 12:00:00", 10046, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, 24, 403, 24003, 0.0, 2, 102301, 2, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "アサヒ", "2020/07/31 12:00:00", 10046, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 0.0, 24, 701, 24004, 1.99, 2, 192201, 1, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "アサヒ", "2020/07/31 12:00:00", 10046, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 0.0, 24, 702, 24005, 2.21, 1, 192201, 2, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "アサヒ", "2020/07/31 12:00:00", 10046, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 0.0, 24, 703, 24006, 3.33, 2, 192201, 1, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "部員３", "2020/07/31 12:00:00", 10046, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, 24, 801, 24007, 0.0, 2, 192301, 2, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "部員３", "2020/07/31 12:00:00", 10046, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 0.0, 24, 802, 24008, 2.68, 1, 192301, 2, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "部員３", "2020/07/31 12:00:00", 10046, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, 24, 803, 24009, 0.0, 2, 192301, 2, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "", "2020/07/31 12:00:00", 10046, "やった！", 0.0, 24, 501, 24010, 0.0, 1, 192501, 1, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "", "2020/07/31 12:00:00", 10046, "勝ったよ！", 0.0, 24, 502, 24011, 0.0, 1, 192501, 1, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "", "2020/07/31 12:00:00", 10046, "いい調子！", 0.0, 24, 503, 24012, 0.0, 1, 192501, 1, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "ミサト", "2020/07/31 12:00:00", 10046, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 0.0, 24, 111, 24013, 5.33, 6, 113501, 2, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "ミサト", "2020/07/31 12:00:00", 10046, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 0.0, 24, 112, 24014, 6.85, 1, 113501, 2, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "ミサト", "2020/07/31 12:00:00", 10046, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 0.0, 24, 113, 24015, 3.0, 1, 113501, 2, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "ダイチ", "2020/07/31 12:00:00", 10046, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 0.0, 24, 611, 24016, 6.11, 1, 192401, 2, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "ダイチ", "2020/07/31 12:00:00", 10046, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 0.0, 24, 612, 24017, 6.75, 1, 192401, 2, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "ダイチ", "2020/07/31 12:00:00", 10046, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, 24, 613, 24018, 0.0, 2, 192401, 2, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "ハツネ", "2020/07/31 12:00:00", 10046, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 0.0, 24, 211, 24019, 4.52, 2, 113401, 1, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "ハツネ", "2020/07/31 12:00:00", 10046, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 0.0, 24, 212, 24020, 3.89, 2, 113401, 1, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "ハツネ", "2020/07/31 12:00:00", 10046, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 0.0, 24, 213, 24021, 13.49, 1, 113401, 2, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "カヤ", "2020/07/31 12:00:00", 10046, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 0.0, 24, 311, 24022, 3.17, 1, 106501, 2, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "カヤ", "2020/07/31 12:00:00", 10046, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 0.0, 24, 312, 24023, 4.42, 1, 106501, 2, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "カヤ", "2020/07/31 12:00:00", 10046, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 0.0, 24, 313, 24024, 2.89, 6, 106501, 1, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "アヤネ", "2020/07/31 12:00:00", 10046, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 0.0, 24, 421, 24025, 3.71, 4, 102301, 3, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "アサヒ", "2020/07/31 12:00:00", 10046, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 0.0, 24, 721, 24026, 5.1, 2, 192201, 1, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "部員３", "2020/07/31 12:00:00", 10046, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 0.0, 24, 821, 24027, 4.34, 1, 192301, 3, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "", "2020/07/31 12:00:00", 10046, "いい勝負だったよ\nまたやろうね", 0.0, 24, 521, 24028, 0.0, 1, 192501, 1, 0.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "ミサト", "2020/07/31 12:00:00", 10046, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 0.0, 24, 101, 24029, 5.62, 1, 113501, 2, -360.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "ミサト", "2020/07/31 12:00:00", 10046, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 0.0, 24, 102, 24030, 9.58, 1, 113501, 2, -360.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "ミサト", "2020/07/31 12:00:00", 10046, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 0.0, 24, 103, 24031, 0.0, 2, 113501, 2, -360.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "ミサト", "2020/07/31 12:00:00", 10046, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 0.0, 24, 104, 24032, 9.13, 2, 113501, 1, -360.0);
INSERT INTO `v1_3e903e256a2deca464eed6d7ea1d205530d2a0f531cddaa7fe29eff7af993dd4` VALUES ("2030/12/17 14:59:59", "ミサト", "2020/07/31 12:00:00", 10046, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 0.0, 24, 105, 24033, 8.27, 1, 113501, 2, -360.0);
